import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import { Navbar, NavItem, Dropdown, Icon, Divider } from "react-materialize";
export default function NavBar() {
  return (
    <Navbar
      alignLinks="right"
      brand={
        <a className="brand-logo" href="#">
          Logo
        </a>
      }
      id="mobile-nav"
      menuIcon={<Icon>menu</Icon>}
      options={{
        draggable: true,
        edge: "left",
        inDuration: 250,
        onCloseEnd: null,
        onCloseStart: null,
        onOpenEnd: null,
        onOpenStart: null,
        outDuration: 200,
        preventScrolling: true
      }}
    >
      <Dropdown
        id="Dropdown_6"
        options={{
          alignment: "left",
          autoTrigger: true,
          closeOnClick: true,
          constrainWidth: true,
          container: null,
          coverTrigger: true,
          hover: false,
          inDuration: 150,
          onCloseEnd: null,
          onCloseStart: null,
          onOpenEnd: null,
          onOpenStart: null,
          outDuration: 250
        }}
        trigger={
          <a href="#!">
            More Info <Icon right>arrow_drop_down</Icon>
          </a>
        }
      >
        <a href="#">Create Account</a>
        <a href="#">two</a>
        <Divider />
        <a href="#">three</a>
      </Dropdown>
    </Navbar>
  );
}
